import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createData(name,) {
  return { name };
}

const rows = [
  createData('肤色'),
  createData('左眼皮'),
  createData('右眼皮'),
  createData('鱼尾纹'),
  createData('黑眼圈'),
  createData('黑头'),
  createData('皮肤类型'),
];

export default function FaceFeedback(props) {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>分析种类</TableCell>
            <TableCell align="right">反馈报告</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{props.skin_color}</TableCell>
              <TableCell align="right">{props.left_eyelids}</TableCell>
              <TableCell align="right">{props.right_eyelids}</TableCell>
              <TableCell align="right">{props.eye_pouch_serverity}</TableCell>
              <TableCell align="right">{props.dark_circle}</TableCell>
              <TableCell align="right">{props.blackhead}</TableCell>
              <TableCell align="right">{props.skin_type}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
